Body flattened, elongate (ratio max length/max width: 
2.75–2.96
); colour uniformly dark brown; body vestiture consisting of very short, recumbent dark setae, denser on elytral tubercles; setae more erect and longer on antennae.

The only record from Tasmania is an old specimen with no detailed locality information (
SAMA
) and it is herein considered doubtful because no other record from the same area is available and the specimen may have been mislabeled.
